import './Feed.css'
import Post from './Post';
import TweetBox from './TweetBox';

function Feed() {
    return (
        <div className='feed'>
            {/*Header*/}
            <div className='feed__header'>
            <h2>Home</h2>
            </div>
            {/* TweetBox */}
            <TweetBox />
           
            <Post displayName="Sonny Sangha"
            username='ssssangha'
            verified={true}
            text="YO"
            avatar="https://cdn.arstechnica.net/wp-content/uploads/2021/09/GettyImages-1315228697-800x533.jpg"
            />
            <Post />
            <Post />
            <Post />
            <Post />
        </div>
    )
}

export default Feed
